import './SpyTable.css';
import { MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';

const SpyTable = (props) => {
    const {spy} = props;
    const data = {
        columns: [
            {
                label: 'Company',
                field: 'company'
            },{
                label: 'Ticker',
                field: 'ticker'
            },{
                label: 'Price',
                field: 'price'
            },{
                label: 'Weight',
                field: 'weight'
            }
        ],
        rows: spy
    }

    return <MDBTable className="heldTable" rules='none' scrollY border='1' maxHeight='25rem'>
        <MDBTableHead columns={data.columns} />
